let markdwon_list = [];

const issues = $input.first().json.data.repository.issues.nodes;

for (let i = 0; i < issues.length; i++) {
  const issue = issues[i];
  if (!issue.author?.login) continue;

  const comments_text = issue.comments?.nodes.length ? issue.comments.nodes.map(c => `- ${c.body}`).join('\n') : "NA";
  const labels_text = issue.labels.edges.length ? issue.labels.edges.map(edge => edge.node.name).join(",") : "NA";
  const issue_type = issue.issueType ?? "NA";

  markdwon_list.push(`
    ## Issue ${i}
    **Title**: ${issue.title}
    **Type**: ${issue_type}
    **Labels**: ${labels_text}
    **Body**: ${issue.body}
    **Comments**: ${comments_text}
    **URL**: ${issue.url}
  `)
}

return {
  markdown_list: markdwon_list.join('\n')
}

const createBulletedList = (items) => {
      if (!Array.isArray(items) || items.length === 0) {
          return '';
      }
      return items.map(item => `<mj-text mj-class="section-content">‚Ä¢ ${item}</mj-text>`).join('<br/>');
  };

  let summary = `
      <mj-section padding="15px">
          <mj-column border="1px solid #dddddd" background-color="#FCF0D2">
              <mj-text mj-class="section-title">üìå Quick Summary</mj-text>
              ${createBulletedList($('Merge').all().map(item => item.json.output.summary))}
          </mj-column>
      </mj-section>`;

  let issues = [];

  for (const issue of $('Merge').all()) {
      let issueInfo = `<mj-text mj-class="issue-title">${issue.json.issueTitle}</mj-text>
                      <mj-spacer/>
                      <mj-text mj-class="section-title">üßæ Issue Description</mj-text>
                      <mj-text mj-class="section-content">${issue.json.issueDescription}</mj-text>
                      <mj-text mj-class="section-title">üß© Root Cause</mj-text>
                      <mj-text mj-class="section-content">${issue.json.output.rootCause}</mj-text>`;
      let resolutionApproach = `<mj-text mj-class="section-title">üõ†Ô∏è Resolution Approach</mj-text><mj-text font-size="14px" line-height="1.6">`;
      resolutionApproach += createBulletedList(issue.json.output.resolutionApproach);
      resolutionApproach += '</mj-text>';

      let issueSuitability = `<mj-text mj-class="section-title">‚úÖ Issue Suitability: ${issue.json.issueSuitability.level}</mj-text><mj-text font-size="14px" line-height="1.6">`
      issueSuitability += createBulletedList(issue.json.issueSuitability.reasons);
      issueSuitability += '</mj-text>';

      let technicalDifficulty = `<mj-text mj-class="section-title">üßó Technical Difficulty: ${issue.json.output.technicalDifficulty.level}</mj-text><mj-text font-size="14px" line-height="1.6">`
      technicalDifficulty += createBulletedList(issue.json.output.technicalDifficulty.reasons);
      technicalDifficulty += '</mj-text>';

      let issuelink = `<mj-text mj-class="section-title"><p>üëâ Go to Issue <a href="${issue.json.issueURL}">(Link)</a></p></mj-text>`;

      issues.push(issueInfo + resolutionApproach + issueSuitability + technicalDifficulty + issuelink)
  }

  return {
      issueHTML: `
          <mjml>
            <mj-head>
                  <mj-attributes>
                      <mj-class name="issue-title" font-size="22px" />
                      <mj-class name="section-title" font-size="15px" font-weight="bold"/>
                      <mj-class name="section-content" font-size="14px" line-height="1.6"/>
                  </mj-attributes>
              </mj-head>
              <mj-body>
                  <mj-section>
                      <mj-column>
                          <mj-image src="https://lh3.googleusercontent.com/d/1bveO7WYcxDDMgPJGCKniHpxKWUJkgDqf" width="1000" height="150"/>
                      </mj-column>
                  </mj-section>
                  <mj-divider  border-width="1px" border-color="#D3D3D3"/> 
                  <mj-wrapper>
                      ${summary}
                      <mj-section>
                          <mj-column>
                              ${issues.join(`<mj-divider  border-width="1px" border-color="#D3D3D3"/>`)}
                          </mj-column>
                      </mj-section>
                  </mj-wrapper>
          </mj-body>
          </mjml>`
  }

const mjml2html = require('mjml');
  return {
      htmlOutput: mjml2html($input.first().json.issueHTML)
  }

parameters.query:
=
    query {
        repository(owner: "{{ $json.owner }}", name: "{{ $json.name }}") {
            issues(first: 10, states: OPEN, orderBy: { field: CREATED_AT, direction: DESC }) {
                nodes {
                    title
                    url
                    body
                    author {
                        ... on User {
                            login
                        }
                    }
                    issueType {
                        name
                    }
                    labels(first: 5) {
                        edges {
                            node {
                                name
                            }
                        }
                    }
                    comments(first: 10) {
                        nodes {
                            body
                        }
                    }
                }
            }
        }
    }

